import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  background-color: #f7f7f7;
  width: 100%;
  height: 100%;
`;
const Header = styled.div`
  width: 100%;
  border-bottom: solid 1px #dbdbdb;
  height: 64px;
`;
function Login() {
  return (
    <Wrapper>
      <Header></Header>
    </Wrapper>
  );
}

export default Login;
